export default class Tool extends React.Component{
    
    render(){
        return( 
            <div className="tool">
                <button className="info"><i class="bi bi-info-circle"></i></button>
                <button><i className="bi bi-stack"></i> Name</button>
                <button className="btn-margin-right"><i class="bi bi-layout-text-sidebar-reverse"></i></button>
                <button className="btn-margin-left"><i class="bi bi-grid-3x3"></i></button>
            </div>        )
    }
}
